// src/components/UserList.tsx

import React from 'react';
import { User } from '../models/User';
import {
  IconButton,
  List,
  ListItem,
  ListItemText,
  ListItemSecondaryAction,
} from '@mui/material';
import EditIcon from '@mui/icons-material/Edit';
import DeleteIcon from '@mui/icons-material/Delete';
import VisibilityIcon from '@mui/icons-material/Visibility';

interface UserListProps {
  users: User[];
  onDelete: (userId: string) => void;
  onEdit: (user: User) => void;
  onView: (user: User) => void;
}

const UserList: React.FC<UserListProps> = ({ users, onDelete, onEdit, onView }) => {
  return (
    <List>
      {users.map(user => (
        <ListItem key={user._id}>
          <ListItemText primary={user.username} secondary={user.email} />
          <ListItemSecondaryAction>
            <IconButton edge="end" onClick={() => onView(user)} aria-label="view">
              <VisibilityIcon />
            </IconButton>
            <IconButton edge="end" onClick={() => onEdit(user)} aria-label="edit">
              <EditIcon />
            </IconButton>
            <IconButton edge="end" onClick={() => onDelete(user._id)} aria-label="delete">
              <DeleteIcon />
            </IconButton>
          </ListItemSecondaryAction>
        </ListItem>
      ))}
    </List>
  );
};

export default UserList;
